function CreateUser(){
    const [stepValue, setStepValue] = useState
    return(
        <div className="MainC">
            <div className="textUserContentC">
                <h2 className='createAccount'>Crear Usuario</h2>
            </div>
            <AddName/>
            <AddEmail/>
        </div>
    );
}
export default CreateUser;
